import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';
import jsPDF from 'jspdf';
import autoTable from 'jspdf-autotable';
import { ComunicationService } from '../../Servicios/comunication.service';



// Base64 strings for star images (replace these with your actual base64 encoded images)
const fullStar = 'data:image/png;base64,';
const emptyStar = 'data:image/png;base64,'



export interface Evaluacion {
  id: string;
  nombreServicio: string;
  aseo: number;
  trato: number;
  puntualidad: number;
}

@Component({
  selector: 'app-reportes',
  standalone: true,
  imports: [CommonModule, FormsModule],
  templateUrl: './reportes.component.html',
  styleUrls: ['./reportes.component.css']
})
export class ReportesComponent {
  evaluaciones: Evaluacion[] = []; // Este es mi datasource

  aseoRatings: number[] = [];
  tratoRatings: number[] = [];
  puntualidadRatings: number[] = [];

  constructor(private servicio: ComunicationService) {}

  getEvaluaciones() {
    this.servicio.getEvaluaciones().subscribe(
      response => {
        console.log('Datos recibidos de posgress', response);

        this.evaluaciones = response; // Aqu igualo a mi datasource

        // Limpiar arrays antes de agregar nuevos datos
        this.aseoRatings.splice(0, this.aseoRatings.length);
        this.tratoRatings.splice(0, this.tratoRatings.length);
        this.puntualidadRatings.splice(0, this.puntualidadRatings.length);

        // Actualizar arrays con los nuevos datos
        for (const evaluacion of this.evaluaciones) {
          this.aseoRatings.push(evaluacion.aseo);
          this.tratoRatings.push(evaluacion.trato);
          this.puntualidadRatings.push(evaluacion.puntualidad);
        }
      },
      error => {
        console.error('Error al enviar datos al servidor:', error);
      }
    );
  }

  get aseoAverage(): number {
    return this.calculateAverage(this.aseoRatings);
  }

  get aseoCount(): number {
    return this.aseoRatings.length;
  }

  get tratoAverage(): number {
    return this.calculateAverage(this.tratoRatings);
  }

  get tratoCount(): number {
    return this.tratoRatings.length;
  }

  get puntualidadAverage(): number {
    return this.calculateAverage(this.puntualidadRatings);
  }

  get puntualidadCount(): number {
    return this.puntualidadRatings.length;
  }

  private calculateAverage(ratings: number[]): number {
    const sum = ratings.reduce((a, b) => a + b, 0);
    return sum / ratings.length;
  }

  private drawStars(doc: jsPDF, rating: number, x: number, y: number) {
    const fullStarCount = Math.floor(rating);
    const emptyStarCount = 5 - fullStarCount;
    let offsetX = 0;

    for (let i = 0; i < fullStarCount; i++) {
      doc.addImage(fullStar, 'PNG', x + offsetX, y, 10, 10);
      offsetX += 10;
    }

    for (let i = 0; i < emptyStarCount; i++) {
      doc.addImage(emptyStar, 'PNG', x + offsetX, y, 10, 10);
      offsetX += 10;
    }
  }

  generatePDF() {
    const doc = new jsPDF();

    doc.setFontSize(20);
    doc.setFont('helvetica', 'bold');
    const title = 'Reportes de reas de Mejora HospiTEC';
    const titleWidth = doc.getTextWidth(title);
    const pageWidth = doc.internal.pageSize.getWidth();
    const titleX = (pageWidth - titleWidth) / 2;
    doc.text(title, titleX, 20);

    // Subttulos
    doc.setFontSize(16);
    doc.setFont('helvetica', 'bold');

    doc.text('Aseo', 10, 30);
    doc.setFontSize(12); // Tamao de letra ms pequeo para el contenido
    doc.setFont('helvetica', 'normal');
    doc.text(`Promedio: ${this.aseoAverage.toFixed(1)} / 5`, 10, 40);
    this.drawStars(doc, this.aseoAverage, 10, 45);
    doc.text(`Cantidad de calificaciones: ${this.aseoCount}`, 10, 60);

    doc.setFontSize(16);
    doc.setFont('helvetica', 'bold');
    doc.text('Trato', 10, 70);
    doc.setFontSize(12);
    doc.setFont('helvetica', 'normal');
    doc.text(`Promedio: ${this.tratoAverage.toFixed(1)} / 5`, 10, 80);
    this.drawStars(doc, this.tratoAverage, 10, 85);
    doc.text(`Cantidad de calificaciones: ${this.tratoCount}`, 10, 100);

    doc.setFontSize(16);
    doc.setFont('helvetica', 'bold');
    doc.text('Puntualidad', 10, 110);
    doc.setFontSize(12);
    doc.setFont('helvetica', 'normal');
    doc.text(`Promedio: ${this.puntualidadAverage.toFixed(1)} / 5`, 10, 120);
    this.drawStars(doc, this.puntualidadAverage, 10, 125);
    doc.text(`Cantidad de calificaciones: ${this.puntualidadCount}`, 10, 140);

    // Crear una tabla con los datos de las evaluaciones sin la columna ID
    const columns = ['Nombre del Servicio', 'Aseo', 'Trato', 'Puntualidad'];
    const rows = this.evaluaciones.map(evaluacion => [
      evaluacion.nombreServicio,
      evaluacion.aseo.toString(),
      evaluacion.trato.toString(),
      evaluacion.puntualidad.toString()
    ]);

    autoTable(doc, {
      startY: 150,
      head: [columns],
      body: rows,
    });

    doc.save('reportes.pdf');
  }
}
